
window.addEventListener("DOMContentLoaded",function(){replaceSeoText(100)},false);function replaceSeoText(a){if(typeof jQuery!="undefined"){var b=$(".content.seo"),c=$(".seo-container");if(b.length&&c.length){c.children(".container").html(b)}else{b.remove();c.remove()}}else{setTimeout(function(){replaceSeoText(a)},a)}};